INSERT INTO `REPORT_ENTRIES` (`id`, `reportId`, `orderBy`, `field_name`, `field_key`, `html_value`, `delta_value`, `blog_type`, `status`, `created_date`) VALUES
(1, 'abba-father', 0, 'Write Blog', 'Write Blog', '<h1>ABBA FATHER</h1><h2><br></h2><h2>Matthew 3:17 New King James Version</h2><p>17 And suddenly a voice came from heaven, saying, “This is My beloved Son, in whom I am well pleased.”</p><p><br></p><h2>Matthew 17:5 New King James Version</h2><p>5 While he was still speaking, behold, a bright cloud overshadowed them; and suddenly a voice came out of the cloud, saying, “This is My beloved Son, in whom I am well pleased. Hear Him!”</p><p><br></p><h2>Romans 8:19 New King James Version</h2><p>19 For the earnest expectation of the creation eagerly waits for the revealing of the sons of God.</p><p><br></p><p><strong>God willing the Holy Spirit will anoint JITHU CS to write in His time.</strong></p>', '{\"ops\":[{\"insert\":\"ABBA FATHER\"},{\"attributes\":{\"header\":1},\"insert\":\"\\n\"},{\"attributes\":{\"header\":2},\"insert\":\"\\n\"},{\"insert\":\"Matthew 3:17 New King James Version\"},{\"attributes\":{\"header\":2},\"insert\":\"\\n\"},{\"insert\":\"17 And suddenly a voice came from heaven, saying, \\u201cThis is My beloved Son, in whom I am well pleased.\\u201d\\n\\nMatthew 17:5 New King James Version\"},{\"attributes\":{\"header\":2},\"insert\":\"\\n\"},{\"insert\":\"5 While he was still speaking, behold, a bright cloud overshadowed them; and suddenly a voice came out of the cloud, saying, \\u201cThis is My beloved Son, in whom I am well pleased. Hear Him!\\u201d\\n\\nRomans 8:19 New King James Version\"},{\"attributes\":{\"header\":2},\"insert\":\"\\n\"},{\"insert\":\"19 For the earnest expectation of the creation eagerly waits for the revealing of the sons of God.\\n\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"God willing the Holy Spirit will anoint JITHU CS to write in His time.\"},{\"insert\":\"\\n\"}]}', '1', 'A', '2025-12-13 17:42:44'),
(2, 'jesus-christ', 0, 'Write Blog', 'Write Blog', '<h1>JESUS CHRIST</h1><p><br></p><h2>1 John 4:17</h2><p><br></p><p>New King James Version 17 Love has been perfected among us in this: that we may have boldness in the day of judgment; because as He is, so are we in this world.</p><h1><br></h1><h2>Romans 8:17</h2><p><br></p><p>New King James Version 17 and if children, then heirs—heirs of God and joint heirs with Christ, if indeed we suffer with Him, that we may also be glorified together.</p><h1><br></h1><h2>Romans 8:32</h2><p><br></p><p>New King James Version 32 He who did not spare His own Son, but delivered Him up for us all, how shall He not with Him also freely give us all things?</p><h1><br></h1><h3><strong>God willing the Holy Spirit will anoint JITHU CS to write in His time.</strong></h3>', '{\"ops\":[{\"insert\":\"JESUS CHRIST\"},{\"attributes\":{\"header\":1},\"insert\":\"\\n\"},{\"insert\":\"\\n1 John 4:17\"},{\"attributes\":{\"header\":2},\"insert\":\"\\n\"},{\"insert\":\"\\nNew King James Version 17 Love has been perfected among us in this: that we may have boldness in the day of judgment; because as He is, so are we in this world.\\n\"},{\"attributes\":{\"header\":1},\"insert\":\"\\n\"},{\"insert\":\"Romans 8:17\"},{\"attributes\":{\"header\":2},\"insert\":\"\\n\"},{\"insert\":\"\\nNew King James Version 17 and if children, then heirs\\u2014heirs of God and joint heirs with Christ, if indeed we suffer with Him, that we may also be glorified together.\\n\"},{\"attributes\":{\"header\":1},\"insert\":\"\\n\"},{\"insert\":\"Romans 8:32\"},{\"attributes\":{\"header\":2},\"insert\":\"\\n\"},{\"insert\":\"\\nNew King James Version 32 He who did not spare His own Son, but delivered Him up for us all, how shall He not with Him also freely give us all things?\\n\"},{\"attributes\":{\"header\":1},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"God willing the Holy Spirit will anoint JITHU CS to write in His time.\"},{\"attributes\":{\"header\":3},\"insert\":\"\\n\"}]}', '1', 'A', '2025-12-13 17:49:06'),
(3, 'holy-spirit', 0, 'Write Blog', 'Write Blog', '<h1>HOLY SPIRIT</h1><p><br></p><h2>John 14:16-17 New King James Version</h2><p>16 And I will pray the Father, and He will give you another Helper, that He may abide with you forever— 17 the Spirit of truth, whom the world cannot receive, because it neither sees Him nor knows Him; but you know Him, for He dwells with you and will be in you.</p><p><br></p><h2>John 16:13-14 New King James Version</h2><p>13 However, when He, the Spirit of truth, has come, He will guide you into all truth; for He will not speak on His own authority, but whatever He hears He will speak; and He will tell you things to come. 14 He will glorify Me, for He will take of what is Mine and declare it to you.</p><p><br></p><h2>Acts 2:17-18 New King James Version</h2><p>17 ‘And it shall come to pass in the last days, says God, That I will pour out of My Spirit on all flesh; Your sons and your daughters shall prophesy, Your young men shall see visions, Your old men shall dream dreams. 18 And on My menservants and on My maidservants I will pour out My Spirit in those days; And they shall prophesy.</p><p><br></p><h3><strong>God willing the Holy Spirit will anoint JITHU CS to write in His time.</strong></h3>', '{\"ops\":[{\"insert\":\"HOLY SPIRIT\"},{\"attributes\":{\"header\":1},\"insert\":\"\\n\"},{\"insert\":\"\\nJohn 14:16-17 New King James Version\"},{\"attributes\":{\"header\":2},\"insert\":\"\\n\"},{\"insert\":\"16 And I will pray the Father, and He will give you another Helper, that He may abide with you forever\\u2014 17 the Spirit of truth, whom the world cannot receive, because it neither sees Him nor knows Him; but you know Him, for He dwells with you and will be in you.\\n\\nJohn 16:13-14 New King James Version\"},{\"attributes\":{\"header\":2},\"insert\":\"\\n\"},{\"insert\":\"13 However, when He, the Spirit of truth, has come, He will guide you into all truth; for He will not speak on His own authority, but whatever He hears He will speak; and He will tell you things to come. 14 He will glorify Me, for He will take of what is Mine and declare it to you.\\n\\nActs 2:17-18 New King James Version\"},{\"attributes\":{\"header\":2},\"insert\":\"\\n\"},{\"insert\":\"17 \\u2018And it shall come to pass in the last days, says God, That I will pour out of My Spirit on all flesh; Your sons and your daughters shall prophesy, Your young men shall see visions, Your old men shall dream dreams. 18 And on My menservants and on My maidservants I will pour out My Spirit in those days; And they shall prophesy.\\n\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"God willing the Holy Spirit will anoint JITHU CS to write in His time.\"},{\"attributes\":{\"header\":3},\"insert\":\"\\n\"}]}', '1', 'A', '2025-12-13 17:54:49');
